import React from 'react';
import CardList from './CardList';
import SearchBox1 from './SearchBox1';
import {robots} from './robots';
const App = () => {
  return (
    <div className= 'tc'>
      <h1>RoboFriends</h1>
      <SearchBox1/>
      <CardList robots={robots} />
    </div>
  );
}

export default App;
